import { createContext, useContext } from "react";
import {v4} from 'uuid';

export const WorkspaceContext = createContext();

const initialData = [
    {
      id: v4(),
      title: 'DSA',
      files: [
        {
          id: v4(),
          title: 'index',
          code: 'cout<<"hello world";',
          language: 'cpp',
        },
      ],
    },

    {
        id: v4(),
        title: 'Frontend',
        files: [
          {
            id: v4(),
            title: 'index',
            code: 'cout<<"hello world";',
            language: 'cpp',
          },
        ],
      },
  ];
  

export const WorkspaceProvider = ({ children }) => {
    const obj = { name: 'andrew' };
    const uniqId = v4();
    console.log(uniqId);

    return (
      <WorkspaceContext.Provider value={obj}>
        {children}
      </WorkspaceContext.Provider>
    );
};
